import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

import Saved from './Saved.js';
import Home from './Home.js';

function App() {
  return (
    <div className="App">
      <Router>
          <Switch>
            <Route exact path="/" component={Home} />
            <Route exact path="/Favs" component={Saved } />

          </Switch>

      </Router>
    </div>
  );
}

export default App;
